import React, { useState } from "react";
import { Flex, Text, Image, Box, Button , } from "@chakra-ui/react";
// import Bag from "../Image/Bag.png";
// import User from "../Image/User.png";
import Menu from "../Image/Menu.png";
import Close from "../Image/Close.png";

function Navbar(props) {
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => setIsOpen(!isOpen);
  return (
    <NavBarContainer {...props}>
      <a href="/">
        <Text as="h1" fontWeight="500" fontSize="3xl">
          Logo
        </Text>
        <MenuToggle toggle={toggle} isOpen={isOpen} />
      </a>
    </NavBarContainer>
  );
}

export default Navbar;

const MenuToggle = ({ toggle, isOpen }) => {
  return (
    <Box display={{ base: "block", md: "none" }} onClick={toggle}>
      {isOpen ? (
        <Image src={Close} boxSize='30px' alt="close-icon" />
      ) : (
        <Image src={Menu} boxSize='30px' alt="Menu-icon" />
      )}
    </Box>
  );
};

const MenuLinks = ({ isOpen }) => {
    return (
        <Box
            display={{ base: isOpen ? "block" : "none", md: "block" }}
            flexBasis={{ base: "100%", md: "auto" }}
        >
            <Stack
                spacing={8}
                align="center"
                justify={["center", "space-between", "flex-end", "flex-end"]}
                direction={["column", "row", "row", "row"]}
                pt={[4, 4, 0, 0]}

            >
                <NavHashLink to="/#projects">
                    <Text display="block" fontWeight="700" >
                        Projects
                    </Text>
                </NavHashLink>

                <NavHashLink to="/#skills">
                    <Text display="block" fontWeight="700" >
                        Skills
                    </Text>
                </NavHashLink>


                <NavHashLink to="/#about">
                    <Text display="block" fontWeight="700" >
                        About
                    </Text>
                </NavHashLink>

                <NavHashLink to="/#blogs">
                    <Text display="block" fontWeight="700" >
                        Blog
                    </Text>
                </NavHashLink>

                <NavHashLink to="/#contact">
                    <Button
                        size="sm"
                        variant="primary"
                    >
                        Contact Me
                    </Button>
                </NavHashLink>





            </Stack>
        </Box>
    );
};

const NavBarContainer = ({ children, ...props }) => {
  return (
    <Flex
      as="nav"
      align="center"
      justify="space-between"
      wrap="wrap"
      w="100vw"
      p="1%"
      border="1px solid yellow"
      {...props}
    >
      {children}
    </Flex>
  );
};
